Welcome New Loyalty Members to Your Program

To welcome new loyalty members, create a data extension that includes the member's details. You can then use this data extension to trigger a series of emails or messages to the new member.

Create a Welcome Series in Journey Builder

1. Locate the Data Extension in Marketing Cloud Engagement
2. Create a Journey in Journey Builder
3. Add steps to the journey for each email or message you want to send to the new member
4. Use data from the data extension to personalize each step of the journey

Use Scripting Languages to Personalize Your Messages

You can use scripting languages such as AMPscript, Template Language, and JavaScript to personalize your messages based on the data in the data extension.

AMPscript Example:
```
%%[
var @PolicyRowset, @PolicyCount, @PolicyRow, @PolicyNumber, @ProductType

set @PolicyRowset=BuildRowsetFromJson(RA_PolicyInformation,"$.[*]", false)

set @PolicyCount=rowcount(@PolicyRowset)

for @i = 1 to @PolicyCount do 
    set @PolicyRow=row(@PolicyRowset, @i)
    set @PolicyNumber=field(@PolicyRow, "policy_number")
    set @ProductType=field(@PolicyRow, "product_type")

    OutputLine(V("<b>Verify Your Information</b><br />"))
    OutputLine(V("Please take a moment to review your information.<br />"))
    OutputLine(V("<br />"))
    OutputLine(concat("<b>Insurance Policy Number</b>: ", @PolicyNumber, "<br />"));
    OutputLine(V("<br />"));
    OutputLine(concat("<b>Policy Type</b>: ", @ProductType, "<br />"));
    OutputLine(V("<br />"));

next @i
]%%
```
Template Language Example:
```
<% 
var policyRowset = BuildRowsetFromJson(RA_PolicyInformation,"$.[*]", false);

rowcount = rowcount(policyRowset);
for (var i = 1; i <= rowcount; i++) {
    var policyRow = row(policyRowset, i);
    var policyNumber = field(policyRow, "policy_number");
    var productType = field(policyRow, "product_type");

    OutputLine(V("<b>Verify Your Information</b><br />"));
    OutputLine(V("Please take a moment to review your information.<br />"));
    OutputLine(V("<br />"));
    OutputLine(concat("<b>Insurance Policy Number</b>: ", policyNumber, "<br />"));
    OutputLine(V("<br />"));
    OutputLine(concat("<b>Policy Type</b>: ", productType, "<br />"));
    OutputLine(V("<br />"));

}
%>
```
